import Header from "./components/header"
import Portfolio from "./components/portfolio"
import About from "./components/about"
import Footer from "./components/footer"
import Resume from "./components/resume"
import './App.css';

const App = () => {
return (
  <>

<Header />

<About />

<Portfolio />



<Footer />


</>
)
}



export default App;
